style.css:
@-moz-document domain("mail.google.com") {
/* General background and text color */
    body, .aeF, .aeH {
        background-color: #000000 !important; /* Black background for terminal look */
        color: #00FF00 !important; /* Bright green text for terminal style */
    }

    /* Links */
    a {
        color: #00FF00 !important; /* Green links */
    }

    /* Sidebar (menu) */
    .aeN, .TN, .aKz, .aKw, .aeF {
        background-color: #000000 !important;
        color: #00FF00 !important;
    }

    /* Email list */
    .Cp, .aeF {
        background-color: #000000 !important;
        color: #00FF00 !important;
    }

    /* Email content background and text */
    .aeF > div, .ii, .a3s {
        background-color: #000000 !important;
        color: #00FF00 !important;
    }

    /* Buttons */
    .T-I, .T-I-KE {
        background-color: #000000 !important;
        border: 1px solid #00FF00 !important;
        color: #00FF00 !important;
    }

    /* Hover effects */
    .aeF tr:hover, .Cp tr:hover {
        background-color: #003300 !important; /* Dark green hover effect */
    }

    /* Search bar */
    .gb_sf {
        background-color: #000000 !important;
        color: #00FF00 !important;
        border: 1px solid #00FF00 !important;
    }

    /* Scrollbar styling */
    ::-webkit-scrollbar {
        width: 10px;
        background-color: #000000;
    }

    ::-webkit-scrollbar-thumb {
        background-color: #00FF00;
    }

    /* Remove shadows and borders for a flat, terminal look */
    * {
        box-shadow: none !important;
        border-color: #00FF00 !important;
    }
}
